import React from "react";
import styled from "styled-components";
import about_page from "../images/about-page.jpg";

function About() {
    return (
        <div className="about">
            This project is created to help users have an easier time finding recipes based on what they have in the fridge. In addition to the recipes, we have included a function to find restaurants around them.
            <img src={about_page} id="about_page" alt="" style={{ width: 200, height: 200 }} />
        </div>
    );
}

const AboutStyle = styled.div`  
  display: flex;
  flex-direction: column;display: flex;
  flex-direction: column;
   .about_page {
    display: block;
    margin-left: auto;
    margin-right: auto;
   }
`;

export default About;
